// SPDX-License-Identifier: MIT
pragma solidity >=0.4.22 <0.9.0;

import "@openzeppelin/contracts/token/ERC20/ERC20.sol";
import "./juryProposal.sol";
import "./IjuryRegistry.sol";
import "./tokenMigration.sol";
import "@openzeppelin/contracts/access/AccessControl.sol";
import "@openzeppelin/contracts/utils/Pausable.sol";

// this contract will create a new proposals smart contracts that will be deployed on the mainnet 

contract juryRegistry is IjuryRegistry, AccessControl,Pausable{
    using SafeMath for uint256;

    address owner;
    uint256 lockedTimePeriod = 2 minutes; // this is the input of joel when he decide to add the locked time period
    uint256 neededTimeline; // this is the time that keeps updates and counts one month after the add commit balance happen

    bytes32 constant ADMIN_ROLE = keccak256("ADMIN_ROLE");
    bytes32 constant UNSTAKED_WALLET_ROLE = keccak256("UNSTAKED_WALLET_ROLE");

  constructor() public {
    owner = msg.sender;
    _setupRole(DEFAULT_ADMIN_ROLE, owner);
    _setupRole(ADMIN_ROLE, owner);
  }

  // this mapping saves the SPON tokens when the user commits his Balance
  mapping(address => uint256) committedBalance;

  // this mapping is from the user address to the timeline of his commitedBalance 
  // this function is to track the time when the user add a new commit balance and withdraw
  mapping(address => uint256) usersTimeline;

  // this mapping will track the users to only make them merge the committed balance once 
  mapping(address => bool) mergeBalanceAddress;


  // this array for us to track the active Proposals in general
  // it can be used in many ideas in the ui if we know the contracts that are still active
  address[] public activeProposals;
  
  // this arrary for us to track the proposals that eneded and no longer active 
  address[] public endedProposals;
  

  // this counter shows in numbers the total proposals
  // great for showcase in UI in general
  uint256 public totalProposalCounter;


    // this is the real contract address of the new token
    //ERC20 newSponToken = ERC20(0xD1992F0BAcfdb7D195a819306c30eA65F73080af);
    
    
    // this is the fake (for testing) contract address of the new tokenQuantity
    ERC20 newTestSponToken = ERC20(0xD18F0f7A15bc2F472592c11d17c5A77624c636c2);

      // migration contract (mainnet)
      //tokenMigration migration = tokenMigration(0xcaf6048F37888d8a617D13edd9ac797eEF0Fb51e);
      
      // migration contract (testnet)
      tokenMigration migration = tokenMigration(0xb9a45f3684A280Df5caCE4F4A2310076771A86b7);

// this function will creqate a new smart contract proposals from the admin only 
// and will be saved in the blockchaion and also here in this jury Reghisrty contract
function createNewProposal(
    string memory proposalDescription,
    bool correctAnswer,
    uint256 rewardPercent,
    uint256 rewardPercentDecimal,
    uint256 votesLimit
  ) public whenNotPaused() returns (address) {
    require(hasRole(ADMIN_ROLE, msg.sender),"Jury Protocol: this address is not an admin.");
    require(bytes(proposalDescription).length != 0, "Jury Protocol: proposal Description can't be empty.");
    require(rewardPercent > 0, "Jury Protocol: reward cannot be zero.");
    require(rewardPercentDecimal > 0, "Jury Protocol: reward Percent Decimal must be more than zero.");
    juryProposal newProposal =
      new juryProposal(
        proposalDescription,
        correctAnswer,
        rewardPercent,
        rewardPercentDecimal,
        votesLimit
      );

    // adding the proposal address to the activeProposals
    activeProposals.push(address(newProposal));

    // adding the proposal to the total proposal Counter
    totalProposalCounter = totalProposalCounter.add(1);

    emit CreateNewProposal(
      proposalDescription,
      correctAnswer,
      rewardPercent
    );
    return address(newProposal);
  }

  // this function is to add a new admin 
  // admins are allowed to create, end and distribute rewards of smart contract proposals
  function addAdmin(address approvedAdmin) public {
    require(hasRole(DEFAULT_ADMIN_ROLE, _msgSender()),"Jury Protocol: Caller is not a main admin.");
    require(approvedAdmin != address(0),"Jury Protocol: invalied address.");

    grantRole(ADMIN_ROLE, approvedAdmin);
  } 

  // this function is to remove a current admin
  // admins removed can't create,end and distribute rewards of smart contracts proposals
  function removeAdmin(address removedAdmin) public {
    require(hasRole(DEFAULT_ADMIN_ROLE, _msgSender()),"Jury Protocol: Caller is not a main admin.");
    require(removedAdmin != address(0),"Jury Protocol: invalied address.");

    // remove the admin role from an address 
    revokeRole(ADMIN_ROLE, removedAdmin);
  }

  // this function is a check function just to make sure that the user (addrtess) that implement the function is an admin
  function isAdminCheck(address user) public view {
      require(hasRole(ADMIN_ROLE, user),"Jury Protocol: this address is not an admin.");
  }

  // this function is to an address as unstaked  
  // this function will assign a UNSTAKED_WALLET_ROLE (Role) to an address and that address can't use the merge function
  function addUnstakedAddress(address unstakedUser) public {
    require(hasRole(DEFAULT_ADMIN_ROLE, _msgSender()),"Jury Protocol: Caller is not a main admin.");

    grantRole(UNSTAKED_WALLET_ROLE, unstakedUser);
  }
  
  
    uint256 fetched;


  // this function is top end a proposal and distribute Rewards to the addresses with a acorrect vote
  function distributeRewards(address selectedProposal) public whenNotPaused() {
    // here we make sure that the Sponsee admin is the one using that function
    require(hasRole(ADMIN_ROLE, msg.sender),"Jury Protocol: this address is not an admin.");
    
    // here we fetch the index of the proposal smart contract address in the array
    // in order to run a require check on it if its exsists
    // needs to be tested
    //   uint256 fetchedIndex;
    //   for(uint i = 0; i <=activeProposals.length-1;i++){
    //       if(activeProposals[i] == selectedProposal){
    //           fetchedIndex = i;
    //       }
    //   }
    
     // require(activeProposals[fetchedIndex] == selectedProposal,"Jury Protocol: this proposal is not active" );

    // here we create an instance of the selectedProposal
    juryProposal selected = juryProposal(selectedProposal);

    // here we fetch the correct answer from the selected proposal smart cotnract
    bool lockedAnswer = selected.getCorrectAnswer();
    
    // needs to be tested
    // here we take the correct addresses from the proposal selected and save them in the memory array
    // in order to Fetch the commit balance and give reward
    address [] memory correctAddresses = selected.fetchCorrectArray(lockedAnswer);

    // here we get the reward percentage 
    uint256 rewardPercent = selected.getRewardPercent(); // 10% in solidity we cant add float  (10)
    
    // here we fetch the vote limits enterd by the admin in the smart contract proposal 
    uint256 FetchedVotesLimit = selected.getVotesLimit(); // 1000 or what ever the admin picks


    // we need to change this when we go to main net
    uint8 sponDecimals = newTestSponToken.decimals();

    // uint256 rewardPercentInFloat = rewardPercent.div(100); DOESNT WORK
    uint256 rewardPercentInFloat = rewardPercent.mul(10 ** sponDecimals).div(100);

    uint256 rewardPercentInFloat2 = rewardPercent.mul(10 ** sponDecimals).div(1000);


    // the total reward of the fecthed contract proposal address will be saved in this varialbe 
    uint256 totalReward;
    
    uint256 proposalRewardPercentDecimals = selected.getRewardPercentDecimals();
    
    // here we run a loop on the addresses with a correct answer and update their balance
    // and also update the totalReward variable
    if(proposalRewardPercentDecimals == 2){
        
        for(uint i = 0; i <= correctAddresses.length - 1; i++){
            if(i > FetchedVotesLimit - 1){
                break;
            }
            
      address selectedAddress = correctAddresses[i];
      
      uint256 userCommitedBalance = committedBalance[selectedAddress].div(1000000000000000000);
      
      uint256 rewardGranted = userCommitedBalance.mul(rewardPercentInFloat);
  

      committedBalance[selectedAddress] = committedBalance[selectedAddress].add(rewardGranted);

      totalReward = totalReward.add(rewardGranted);

    }
    
     fetched = totalReward;
     
    }else if(proposalRewardPercentDecimals == 3){
        
      for(uint i = 0; i <= correctAddresses.length - 1; i++){
          
          if(i > FetchedVotesLimit - 1){
              break;
          }
      address selectedAddress = correctAddresses[i];
      
      uint256 userCommitedBalance = committedBalance[selectedAddress].div(1000000000000000000);
      
      uint256 rewardGranted = userCommitedBalance.mul(rewardPercentInFloat2);
  

      committedBalance[selectedAddress] = committedBalance[selectedAddress].add(rewardGranted);

      totalReward = totalReward.add(rewardGranted);

    }
    
     fetched = totalReward;
    }
    

    // implement an approve from Sponsee (company) side contract to jury Registry contract from frontend ui
    // transfer the total reward from the admin (sponsee team) to the smart contract and lock it under the correct users addresses 
    newTestSponToken.transferFrom(owner, address(this), totalReward.add(1));

    
    // delete the proposal from the activeProposals array 
     // delete activeProposals[fetchedIndex];
    
    // add the proposal status to be ended Proposal 
    endedProposals.push(selectedProposal);

    // notify
    emit DistributeRewards(selectedProposal);
  }
  
  // this function is to add commit balance from the spon token 
  // the tokens will be transfered to the contract and locked for the timeline period
  // a timeline restriction will be added to the user address so that the tokens can be locked for a specific period
  function addCommitedBalance(uint256 amount) public whenNotPaused() {
    address user = _msgSender();
    require(user != address(0),"Jury Protocol: invalid address.");
    // we need to change this when we go to main net
    require(newTestSponToken.balanceOf(user) > 0, "Jury Protocol: user doesnt own any spon tokens.");

    // we need to make sure that the user commit balance is zero 
    // so that the timer can start again 
    require(getUserCommittedBalance(user) == 0, "you aalready have commit balance, please wirthdraw the current commit balance");

    // we need to change this when we go to main net
    newTestSponToken.transferFrom(user, address(this), amount);

    // update the user commit balance with the amount he entered
    committedBalance[user] = committedBalance[user] + amount;

    // fetch the needed timeline that the token needs to be locked for
    neededTimeline = block.timestamp + lockedTimePeriod;

    // save the needed timeline in the mapping under the users address
    usersTimeline[user] = neededTimeline;

    emit AddCommitedBalance(amount);
  }

  // this function is to allow the user to withdraw his spon commited balance 
  // if the timeline restriction ended the user can wihtdraw his token
  function withdrawCommittedBalance() public whenNotPaused(){
    address user = msg.sender;
    require(user != address(0),"Jury Protocol: invalid address.");
    require(committedBalance[user] > 0, "Jury Protocol: user's committed balance is zero.");
    uint256 SponBalance = newTestSponToken.balanceOf(address(this));

    // fetch the user commited balance
    uint256 userLockedBalance = committedBalance[user];
    require(userLockedBalance <= SponBalance, "Jury Protocol: there is no enough balance in the smart contract.");
    // make sure that the current time is more than the locked timeline under the user address
    // it means that the commited balance needs to be locked for specific time
    require(block.timestamp >= usersTimeline[user], "Jury Protocol: you can't withdraw your balance, spon tokens are still locked in the current timeline");

    // transfer the tokens to the user
    // we need to change this when we go to main net
    newTestSponToken.transfer(user, userLockedBalance);
    
    // update his new commited balance to zero in jury Registry contract
    committedBalance[user] = 0;

    // rteset the timeline for the user address
    usersTimeline[user] = 0 hours;

    // notify
    emit WithdrawCommittedBalance(user,userLockedBalance);

  }

  function mergeCommittedBalance()public{
    address user = msg.sender;

    require(user != address(0), "Jury Protocol: invalid address.");
    require(migration.getUserCommittedBalance(user) > 0, "Jury Protocol: user does not own any commit balance."); // must be tested
    require(mergeBalanceAddress[user] == false, "Jury Protocol: the user already merged his balance.");
    require(hasRole(UNSTAKED_WALLET_ROLE, user) == false,"Jury Protocol: this address manually unstaked.");

    // implement an approve from the sponsee owner contract to jury Registry contract
    // so that we can transfer the user migration committed tokens here in this contract and lock it in here under the user address

    // Fetch the old commit amount from the migration contract
    uint256 amount = migration.getUserCommittedBalance(user);

    // transfer the Spon tokens to the contract and lock them
    newTestSponToken.transferFrom(owner, address(this), amount);

    // add the merged committed balance to his balance in the jury Registry contract
    committedBalance[user] = committedBalance[user] + amount;

    // add his address as true in the tracking mapping in order to not let the user active that function again
    mergeBalanceAddress[user]= true;

    //notify...
    emit MergeCommittedBalance(user, amount);
  }

  // Query functions
  // this function might be usefull to query for the user new Spon tokens to display in frontend when the user connects his wallet
  function newSponBalance(address _user) public view returns (uint256){
      uint256 QueryBalance2 =  newTestSponToken.balanceOf(_user);
      return QueryBalance2;
  }
    

  // this function is to fetch the user spon commited balance locked in the contract
  function getUserCommittedBalance(address _user) public view returns (uint256){
      uint256 queryCommittedBalance = committedBalance[_user];
      return queryCommittedBalance;
  }

   function isCommitBalance(address user) public {
        require(committedBalance[user] > 0,"Jury Protocol: you can't vote without having commit balance");
    } 

  // this function will pasue the smart contract
  // in case of any unexpected thing happen
  // when the contract is pasued it can't use any function 
  function startPause() public whenNotPaused(){
    require(
      hasRole(DEFAULT_ADMIN_ROLE, _msgSender()),
      "Caller is not an admin"
    );

    // we pasue the contract for ever and we end sign it from our side to close it
    super._pause();
  }


  // this function is to unpasue the contract so that the functions can be called again
  function startUnpause() public whenPaused(){

      require(
      hasRole(DEFAULT_ADMIN_ROLE, _msgSender()),
      "Caller is not an admin."
    );
    
    // Active the Unpause function
    super._unpause();

    // Notify...
    emit Unpaused(_msgSender());
  }
}
